import React from 'react';

const Stack = () => {
    const styles = {
        'text-align': 'center'
    }
    return(
        <>
            <h1 style={styles}>My Stack</h1>
            <body>
            <h2>My technical stack</h2>
            </body>
        </>
    )
}

export default Stack;
